  input: '"TEXT","F3XN","C00165688","ASDC Dollars for Democrats, ASDC Partnership
    Program, and the State Democratic Party Victory Fund are joint fundraising programs
    in which the North Carolina Democratic Party participates.   Transfers are made
    to the NCDP on an as-needed basis.  Please note that state party committees have
    been reporting Memo Entries on Schedule A for contributions received by the joint
    fundraising program during the reporting period in which the contribution was
    received irrespective of whether transfers have been made.  Memo Entries on Schedule
    A from these programs reflect the gross amounts raised while the transfers to
    the NCDP reflect the net amount distributed to date.  Accordingly, there will
    always be a difference between the transfer and the Memo Schedule A totals.  By
    prior agreement between the NCDPs counsel and the FEC, Memo Schedule As for these
    programs are reported on a quarterly basis.    The receipt of funds from the State
    of North Carolina disclosed on Schedule A supporting Line 17 reflects the receipt
    of tax check-off funds.    All Memo entries over $200 are disclosed on Schedule
    B supporting Line 21 detailing reimbursements to Joyce Mitchell.  The Memo entries
    do not total the exact amount of the total reimbursement because emany were for
    less than $200.    All Payroll, Payroll Taxes, AFLCA Payroll,  Health Insurance,
    Payroll Pd to Seligman, and Supplemental Insurance disclosed on Schedule H4 are
    for employees who did NOT spend more than 25% of their compensated time in a given
    month on Federal Election Activity (FEA) or activities in connection with a Federal
    election.     No disbursement disclosed on this report referred to a clearly identified
    federal candidate or was made on behalf of a clearly identified federal candidate.  Payment(s)
    disclosed for Printing/Generic were for non-public communication, generic activity.    Payment(s)
    disclosed for Printing/Generic were for non-public communication, generic activity.    Memo
    entries disclosed on Schedule H4 for disbursements to Radisson Hotels were for
    expenses related to the NCDP State Convention.  "'
